R["oh__@capricia13"]="{['Version']=1773,['na']={[83]={['D']='Undaunted? Looking to unwind after a long day of adventuring? Come to the Undaunted Lux Lodge in Markarth!  your host, Stabbi Rabbit, offers everything a weary adventurer needs. Baths, beds, and bottomless tankards of ale. Train for your next battle or enjoy a dive into the icy waters of The Reach. (then thaw out in the sauna)  ',['O']=20008,['N']='Undaunted Lux Lodge',['C']=1.013000,},[71]={['N']='Ants at a picnic',['O']=19988,['D']='You\\'re invited to a picnic with a unique perspective... ',['C']=1.013000,},[103]={['N']='Evil Inc. HQ',['O']=19874,['D']='Built over an ancient shrine to Sithis, the site of Evil Incorporated’s new headquarters is everything an aspiring Evil Overlord could want.\\r\\nEnjoy the ambiance of the dark-as-night entry hall before descending into the heart of a criminal empire in the making. Please remember to sign in at the front desk to avoid unpleasantness and and/or dismemberment.\\r\\n\\n*Inspired by the Evil Overlord\\'s List*',['C']=1.002000,},[110]={['N']='The Veil Nightclub',['O']=19988,['D']='Welcome to the Veil Nightclub, where daedra and undead dance to the driving beat of DJ Arox, the titan of techno. ',['C']=1.038000,},[111]={['N']='Sea Witch Sanctuary',['O']=19988,['D']='Tempest Twice-Cursed hates both sides of her heritage... the high elf she pretends to be and the sea elf half she has to hide.  The sea witch\\'s retreat is the one place she can be herself, and the only place she feels at home. ',['C']=1.018000,},},['Key']='oh__@capricia13',['TS']=1728696844,}"
