R["oh__@kantuuka"]="{['TS']=1728260288,['eu']={[24]={['N']='The Allotment',['O']=19918,['D']='Nestled just outside the bustling city of Dune lies this Small Colorful Allotment. This vibrant oasis, surrounded by the serene marsh, bursts with colorful blooms and lush greenery. A haven for nature enthusiasts and urban gardeners, it offers a peaceful retreat and fosters a sense of community amidst the enchanting flora.',['C']=1.021000,},[90]={['N']='Cave of dreams',['O']=19918,['D']='Cave of Dreams (1st Person Recommended) - Nestled within a mysterious, colorful grotto, radiant crystals illuminate secret chambers of magical difference. In the heart of this enchanting realm lies hidden treasure, guarded by the mystical allure of concealed rooms. Yet, beware the depths, for a pool of lava harbors not just molten heat but also the reflection of hidden fears. Venture bravely, unlock the secrets, and discover the dazzling wonders and perilous mysteries that await within the depth',['C']=1.020000,},[11]={['C']=1.033000,['O']=20003,['D']='Ronanda\\'s Autumn: Nestled in nature, Ronanda\\'s hut is bathed in the warm, golden hues of autumn. The deep reds, vibrant oranges, and rich browns of the season wrap the cozy retreat in a comforting embrace, creating a serene hideaway perfect for quiet reflection amid the falling leaves and the seasons of warm Colors.',['N']='Autumn of Ronanda',},[47]={['N']='Ronanda City',['O']=19354,['D']='',['C']=1.041000,},[40]={['N']='Sct. Punked Harbour',['O']=19311,['D']='Trading Harbour, hidden in the land to the south.',['C']=1.015000,},[110]={['N']='Gold Road Stellarium',['O']=19913,['D']='Nestled within a magic mountain, just beyond the Valente vineyards in the blooming province of Gold Road, lies The Gold Road Stellarium. This hidden scholarium and observatory is a sanctuary of knowledge and cosmic exploration, accessible only to those who discern its subtle enchantments. Here, scholars and stargazers delve into arcane studies, guided by the mountain\\'s mystical energies.',['C']=1.025000,},[71]={['N']='Temple of Potals',['O']=19354,['D']='A EHT friendly \"portal house\" to the newest build of @Sasanah and @Kantuuka - Travel Between our build with simple EHT portal.',['C']=1.037000,},},['Version']=1773,['Key']='oh__@kantuuka',}"
