R["oh__@totes1"]="{['TS']=1727093107,['Key']='oh__@totes1',['na']={[34]={['N']='Forgotten Shrine',['O']=19742,['C']=1.037000,['D']='',},[47]={['N']='The Borg',['O']=19783,['C']=1.032000,['D']='Having assimilated Apocrypha technology into their collective, it is feared the Borg are returning to Tamriel.  Their ominous proclamation echoes through space: ‘We are the Borg. Prepare to be assimilated. Resistance is futile.’\\r\\n(from Star Trek)\\r',},[21]={['N']='Salt & Pepper',['O']=19525,['C']=1.050000,['D']='I challenged myself to create a build using a limited colour palette.  This home is inspired by renovated period homes found around my part of the world. (Relisting)',},[54]={['N']='Stone Warriors',['O']=19898,['C']=1.029000,['D']='Journey’s End\\r\\n\\r\\nAcross the bridge by sunset light \\r\\nHordes of warriors locked in fight \\r\\nEchoes rage from chiselled stone \\r\\nAnd span the chasm once unknown \\r\\n···\\r\\nProve that valour is no guise \\r\\nFor the warrior who is wise \\r\\nScale the cliff and forge a path \\r\\nTo reach the feet of Malacath \\r\\n···\\r\\nBehind the shrine one may ascend \\r\\nTo contemplate the journey’s end -\\r\\nThe clash of steel on broken span \\r\\nA testament to mortal man\\r\\n',},[41]={['N']='Azura\\'s Sanctuary',['O']=19036,['C']=1.037000,['D']='Adorned with lovingly crafted crystal murals and surrounded by beautiful gardens, Azura\\'s Sanctuary is a place for meditation, reflection, and communion with nature.  Many who worship at this ancient site experience profound spiritual awakening, granting inner peace, rejuvenation and a deep connection with the divine. ',},[73]={['N']='Confucian Shrine',['O']=19604,['C']=1.037000,['D']='Confucian shrine.',},[89]={['N']='Mara\\'s Chapel',['O']=18917,['C']=1.037000,['D']='Our doors are open to all for prayer and meditation at this Eastern Orthodox inspired Chapel of Mara. ',},[57]={['N']='Totemkhamen\\'s Tomb',['O']=18993,['C']=1.500000,['D']='��Totemkhamen’s Tomb’ was recently discovered… unfortunately by tomb raiders.  Legend has it that this ancient Egyptian tomb is filled with untold riches, the most exquisite of which are a 3D funerary barge and a solid gold sarcophagus.  Ancient texts speak of hieroglyphs and wall murals adorning the tomb, praising Pharaoh Totemkhamen’s illustrious life, and warning trespassers of the wrath of the gods should they enter.',},[11]={['N']='Pish-Posh Library',['O']=19524,['C']=1.025000,['D']='',},[76]={['N']='Amunet\\'s Tomb',['D']='As archaeologists patiently restore Amunet\\'s Tomb, the faded walls slowly come to life. Forgotten stories etched in hieroglyphs and painted on murals begin to surface - each discovery a glimpse into a world lost to time. \\r\\n',['C']=1.029000,['O']=19989,},[93]={['N']='Unhallowed Ground',['O']=19805,['C']=1.023000,['D']='Concealed within the shadows lies a foreboding priory, its very foundations steeped in the echoes of an ancient malevolence. What sinister forces dwell within its unhallowed grounds and beckon you into an odyssey of darkness?',},[46]={['N']='Tamriel\\'s Top Chef',['O']=19320,['C']=1.040000,['D']='‘lights, camera, action’  - In Studio 1, the pressure is on as our contestants battle it out in the final cook-off for the title of Tamriel���s Top Chef.  How will Rigurt�����s macaroons and cherry dip compare to Mirri’s chocolate marble cake? And will Stibbons serve a hearty stew or will he burn the house down? Oh Stibbons…\\r\\nNote- quiet please backstage, and careful not to trip on the wires.\\r',},[79]={['N']='Lost City of Petra',['O']=19252,['C']=1.500000,['D']='Hidden for centuries within a series of labyrinthian caverns, intrepid explorers recently located the long-lost City of Petra. The perilous search to discover its secrets and reveal its mysteries is already underway… (An Indiana Jones inspired build).\\r\\nNB: Please switch off Magic Carpet���s Featherfall. Snake alert.\\r',},},['Version']=1773,}"
