R["oh__@changuita"]="{['eu']={[68]={['N']='Changuita\\'s EU 1',['O']=19083,},},['Key']='oh__@changuita',['Version']=1773,['TS']=1714351294,['na']={[48]={['N']='Ithelia\\'s Grotto',['D']='In this pocket of Mirrormoor, Ithelia is not forgotten. Shards of glass and light comingle with the darkness, an ode to The Dark Reflection herself. Fey protect her shrine and those of her pragmatic allies, Vaermina and Peryite. Travel deeper into these crystal caverns and you will find a grotto of shattered glass and refracted light. Look, but do not touch the beasts within, they serve an Unseen mistress. Finally, meditate on the infinite possibilities of fate at  the Colors of Light pool.',['C']=1.026000,['O']=19840,},[65]={['N']='Floralvault',['D']='Garden for House Omerta Contest. \\n\\nClockwork City gets a bit drab, so it\\'s denizens often retreat to the Floralvault to relax and meditate. Enjoy the color garden of many seasons and the wandering clockwork caretakers. Sit and enjoy the sights (and SOUNDS!) within. ',['C']=1.021000,['O']=19432,},[66]={['N']='The Dragon Temple',['D']='Dragons are hiding something special in this tricky temple! Can you find your way through the dangerous maze, all the way to the lava hatchery? If you want an added challenge, PM me and I\\'ll turn on the levers! ',['C']=1.037000,['O']=19760,},[71]={['N']='House Omerta House',['D']='Built out of necessity, this Trade Camp brings all the races of Tamriel together peacefully. Find your tent and settle in! All basic crafting stations are provided for your convenience as well as cultural-specific music in the various areas. Please no fighting, let us trade harmoniously! ',['C']=1.041000,['O']=19062,},[54]={['N']='Seasons of Falinesti',['D']='While many theories exist as to why The Walking City of the Bosmer disappeared, one thing is certain: Falinesti is in turmoil. Instead of travelling season to season, it is now experiencing each one, all at once. In an effort to normalize this change, the singers of Y\\'ffre were able to localize Spring, Summer, Autumn and Winter into different zones of the great city. This build follows the Green Pact strictly. ',['C']=1.026000,['O']=19826,},[21]={['N']='The Gambling Grotto',['D']='Enter the Gambling Grotto, but don\\'t get too attached to your coin! Offering a 4x4 random chance grid, this home was created for guild prize events! Fill all the eggs, or only a few, and use a prize:item list to award goodies! The maze isn\\'t a true maze, follow it and find the entrance. The home is decorated to be entertaining while you wait your turn to crack eggs!\\n\\n**MAIL ME IG to rent this home for your guild event!**',['C']=1.003000,['O']=19062,},[86]={['N']='A Depth of Maltar',['D']='Tharrayya\\'s team has unearthed a small offshoot of the Depths of Malatar! Complete with spooky roving bosses, frigid depths, and  otherworldly flora... will you make it past gilded, golden rooms to glimpse the Colored Rooms? ',['C']=1.026000,['O']=19574,},[87]={['N']='Small Sylvan Scene',['D']='A small-scale reskin of the Pilgrim\\'s Rest Inn room, remade to be a woodland nyxad\\'s private home. Enjoy a small escape from reality :)\\n',['C']=1.021000,['O']=19561,},[40]={['N']='House Omerta\\'s Isle',['D']='Even Hircine needs a island getaway! Join House Omerta at our guild home, an Ode to Hircine and his March of Sacrifices. Features include crafting set tables, mundus, vampirism adjusters, training dummies + aetherial well, as well as other beneficial tables. \\n\\nCan you find all 5 lore books? Catch Hircine\\'s Hare, Find Balorgh\\'s cousin, the Golden Indrik, a dormant Aegedh of the Solstice, or even climb the trees and sit in cloud-touching gryphon nests! A perfect escape for weary hunters. ',['C']=1.010000,['O']=19409,},[49]={['N']='Daedric Throne Paths',['O']=18634,},[106]={['N']='Elemental Adytum',['D']='Retreat to this cloistered temple, dedicated to the worship of the elements. Those ordained in the worship of Earth, Water, Fire and Air make a pilgrimage to this holy site to find balance, connect to their core elements, and meditate inwardly.',['C']=1.031000,['O']=19842,},[5]={['N']='Selfies Blackscreen',['D']='Need a place to take selfies of your cute outfit for a costume contest? Feel free to use my blackscreen! 1 or 2 lights on for best results, in midnight! ENJOY!',['C']=1.002000,['O']=19374,},[34]={['N']='The Secret Grotto',['D']='Unda da sea! Unda da sea! Darling it\\'s betta, down where it\\'s wetta, take it from me! We got no troubles, life is the bubbles, unda da sea! ',['C']=1.012000,['O']=19062,},[42]={['N']='The Shroom Room',['D']='A home inspired by the fairy homes of @snowfaeriewings, this was the example home for House Omerta\\'s \"ONLY HOME GOODS\" small spaces housing contest! Using only collectibles and home goods- this small faerie abode is an escape to a wild shroomy grove for 2 nyxad friends who wanted to be neighbors.',['C']=1.021000,['O']=19068,},[14]={['N']='Cloudy Crystal Creek',['D']='The first home I made in ESO. The majority of the build is in the sky, accessible via a semi-hidden pathway to the left. Follow the ladders up to a sky-creek. Feel free to follow the crystals and try to make it to the skyshard! Functional home with most of the crafting stations, etc. ',['C']=1.031000,['O']=19059,},[47]={['N']='House Omerta Lair',['D']='Guild \"game\" home with egg cracking grid, human darts tower, and racetrack. Enjoy this home for your spooky parties, RP, and guild fun nights! \\n\\nPM me if you\\'d like to rent this/the eggs for an event!',['C']=1.003000,['O']=19826,},},}"
