R["fx__eu__@rubitete__72"]="{['Effects']={[1]={['Y']=11562,['EffectType']=8503,['Pitch']=0,['Yaw']=5.523967,['SizeY']=50,['SizeX']=46.456460,['Roll']=0,['Z']=80088,['X']=79596,['MetaData']={['title']='Die Katze und der Kaktus, Teil 2',['message']='von Kalliope 3.7\\n\\nDer Kaktus sagte: �Ich wurde von einem Menschen gepflückt und in einen Topf gesteckt. Er hat mich hierher gebracht und mich auf die Fensterbank gestellt. Er gießt mich manchmal, aber er spricht nicht mit mir. Er scheint mich nicht zu mögen.�\\n\\nDie Katze sagte: �Das ist sehr traurig. Ich mag dich. Du bist sehr interessant. Kann ich dein Freund sein?�\\n\\nDer Kaktus sagte: �Wirklich? Du magst mich? Aber ich habe dich verletzt.�\\n\\nDie Katze sagte: �Das macht nichts. Es war meine Schuld. Ich war zu neugierig. Ich werde dich nicht mehr anfassen. Aber ich möchte dich kennenlernen. Kann ich dein Freund sein?�\\n\\nDer Kaktus sagte: �Ja, das wäre schön. Ich würde gerne einen Freund haben. Du bist sehr freundlich. Du kannst mein Freund sein.�\\n\\nDie Katze und der Kaktus lächelten sich an. Sie fingen an, sich zu unterhalten. Sie erzählten sich von ihren Leben, ihren Träumen und ihren Wünschen. Sie fanden heraus, dass sie viele Gemeinsamkeiten hatten. Sie mochten beide Musik, Sterne und Geschichten. Sie lachten und scherzten miteinander.\\n\\nSie wurden die besten Freunde. Sie verbrachten viel Zeit zusammen. Sie halfen sich gegenseitig. Die Katze brachte dem Kaktus Blumen und Schmetterlinge. Der Kaktus sang der Katze Lieder und Gedichte. Sie machten sich glücklich.\\n\\nUnd so lebten sie noch lange und zufrieden auf der Fensterbank. Sie waren eine ungewöhnliche, aber glückliche Paarung. Die Katze und der Kaktus.\\n',},['SizeZ']=50,['Contrast']=1,['Groups']=0,['Alpha']=1,['Id']=1013,['Color']=519942,},[2]={['Y']=11578,['EffectType']=8503,['Pitch']=0,['Yaw']=5.523967,['SizeY']=50,['SizeX']=46.456460,['Roll']=0,['Z']=80033,['X']=79542,['MetaData']={['title']='Die Katze und der Kaktus, Teil 1',['message']='von Kalliope 3.7\\n\\nEs war einmal eine Katze, die sehr neugierig war. Sie liebte es, neue Dinge \\nzu entdecken und zu erforschen. Eines Tages sah sie einen Kaktus in einem Topf auf der Fensterbank. Sie hatte noch nie einen Kaktus gesehen und wollte ihn genauer ansehen.\\n\\nSie sprang auf die Fensterbank und näherte sich dem Kaktus vorsichtig. Sie roch an ihm und fand, dass er keinen besonderen Geruch hatte. Sie leckte ihn und fand, dass er nicht besonders schmeckte. Sie berührte ihn mit ihrer Pfote und fand, dass er sehr stachelig war.\\n\\n�Au!� miaute sie und zog ihre Pfote zurück. Sie sah, dass sie sich einige Stacheln eingefangen hatte. Sie versuchte, sie mit ihrer Zunge herauszuziehen, aber das tat noch mehr weh. Sie fing an zu jammern und zu klagen.\\n\\nDer Kaktus hörte die Katze und fühlte sich schuldig. Er hatte nicht gewollt, dass sie sich verletzte. Er wollte nur in Ruhe gelassen werden. Er sagte zu der Katze: �Es tut mir leid, dass ich dich gestochen habe. Aber du hättest mich nicht anfassen sollen. Ich bin ein Kaktus und ich habe Stacheln, um mich zu schützen.�\\n\\nDie Katze hörte die Stimme des Kaktus und war überrascht. Sie hatte nicht gewusst, dass er sprechen konnte. Sie sagte zu ihm: �Du kannst sprechen? Wie heißt du?�\\n\\nDer Kaktus sagte: �Ich heiße Karl. Und du?�\\n\\nDie Katze sagte: �Ich heiße Luna. Warum hast du Stacheln? Hast du Angst vor etwas?�\\n\\nDer Kaktus sagte: �Ich habe Stacheln, weil ich in der Wüste gelebt habe. Dort war es sehr heiß und trocken. Ich musste mich vor der Sonne, dem Wind und den Tieren schützen. Deshalb habe ich Stacheln, um Wasser zu speichern und mich zu wehren.�\\n\\nDie Katze sagte: �Das klingt sehr hart. Wie bist du hierher gekommen?�\\n\\n',},['SizeZ']=50,['Contrast']=1,['Groups']=0,['Alpha']=1,['Id']=1015,['Color']=519942,},[3]={['Y']=9815,['EffectType']=4531,['Pitch']=0,['Yaw']=3.263766,['SizeX']=600,['SizeZ']=600,['Roll']=0,['SizeY']=600,['Z']=89153.387137,['Alpha']=0,['Contrast']=4,['Groups']=0,['X']=78239.996242,['Id']=1016,['Color']=999999,},},['Version']=1773,['TS']=1708872118,}"
