R["oh__@rubitete"]="{['TS']=1704153968,['Key']='oh__@rubitete',['eu']={[47]={['D']='The Home of the Addams Family. Beware of the cat!',['N']='IOI Cemetery Lane',['C']=1.044000,['O']=19135,},[14]={['D']='House for a spooky Halloween',['N']='Trick or treat',['C']=1.038000,['O']=19288,},[61]={['D']='As you make your way through the woods, you suddenly find yourself standing in front of a single house on a hill. Once upon a time, it must have been a stately estate. Now it’s run down and abandoned. What happened here?',['N']='Hill House',['C']=1.038000,['O']=19265,},[19]={['D']='Home for a Gothic Girl or Lady. No animals were harmed during this build, but some of 51 daedric thrones were...misused.',['N']='Gothic Apartment',['C']=1.048000,['O']=19215,},[13]={['D']='Small holliday house with garden',['N']='Summer Cottage',['C']=1.021000,['O']=19421,},[21]={['D']='Shopping Arcade. Inspired by old Galeries in Paris. With Tearoom. ',['N']='Galerie Indorilia',['C']=1.500000,['O']=19129,},[38]={['D']='',['N']='Ghostride',['C']=1.023000,['O']=19666,},[71]={['D']='After many years of hard work, this one has finally stol. . . , er, earned enough gold to fulfill her dream of owning a palace. Although the construction is based on the aristocratic townhouses of the Bretons, in the roots of this one in Elsweyr were not forgotten. And this one likes to open her house for night dances and merrymaking.',['N']='Au chat doré ',['C']=1.051000,['O']=19341,},[90]={['D']='Congratulations! You’ve won a golden VIP-Ticket for the hottest Club in Tamriel. Join us on a special night out with DJ Death. Meet Bucephalus, the Club mascot, dance and drink the night away, like it’s your last…',['N']='A hell of a Club',['C']=1.048000,['O']=19177,},[25]={['D']='Small japanese inspired garden with teahouse',['N']='Small garden',['C']=1.021000,['O']=19179,},[26]={['D']='Phrastus the scholar experimented with dark powers in his magician’s tower. One day he summoned an unholy storm. From his tower room, lightning struck the family tomb and unnoticed brought to life an ancient abomination. Later that night, it came to the house, killed Phrastus�� family, and trapped him in a never-ending nightmare that kept him alive, even though his body had long since fallen to dust. Between 4 and 5 in the morning, the monster still appears in his bedroom.',['N']='The Dreaming',['C']=1.038000,['O']=19124,},[22]={['D']='Fashion Atelier',['N']='Rubi Designs',['C']=1.046000,['O']=19213,},[29]={['D']='Cat Café',['N']='Cool Cats & Cakes',['C']=1.024000,['O']=19143,},[45]={['D']='How deep is your love? A mermaid must live here! Mermaids are beautiful princesses in search of true love, for which they sacrifice their former lives. Or do they?',['N']='Mermaid Cave',['C']=1.012000,['O']=19724,},[30]={['O']=19629,['N']='Gasthaus zum Greif',},[63]={['D']='Every night I come here. It always starts in this cellar before I explore the deserted streets. There is snow everywhere. But it\\'s not normal snow. The snow is green. Where have all the inhabitants gone? What happened here? And it always ends the same. Blinded by a bright light and frozen with fear, I awake. With only a vague memory of the horror experienced there.',['N']='Green Snow',['C']=1.023000,['O']=19491,},},['Version']=1773,}"
