R["oh__@thekingsjules"]="{['Key']='oh__@thekingsjules',['na']={[80]={['C']=1.007000,['O']=19468,['D']='A Dwemer and Clockwork creation, the Forge provides access to crafting, outfit customization, banking, and merchanting. This is the Way.',['N']='The Forge',},[98]={['C']=1.007000,['O']=19475,['D']='Eilean Draìocht, a Druid\\'s Paradise. Featuring a Henge of Stonelore, an Undercroft Firesong Circle Meet, and beyond the Smuggler\\'s Cove lies the Reef Circle of Eldertide. Upon the highest hill is the Great Mother Tree, housing the Mother Shrine and a shrine to Y\\'ffre. The lighthouse hosts The Golden Lantern Pub with intimate stage, and a ballroom on the second floor with a platform for musicians and plenty of dancing space. Two romantic vistas, one in the top of the tower and one on the bay.',['N']='Eilean Draìocht',},[38]={['C']=1.007000,['O']=19470,['D']='Chateau Corbeau rests in the heart of High Rock, a picturesque destination featuring ornate formal gardens and greenhouse where tea is set for two, a cozy firepit under the ivy-covered pergola, a ballroom with plenty of open floor space for dancers, a great hall laid out for a feast with head table at the dais...and its gorgeous little Chapel to the Eight Divines...ready to host your events be they weddings, revels, or a romantic getaway...enjoy the delights the Raven offers. ',['N']='Chateau Corbeau',},[71]={['C']=1.007000,['O']=19468,['D']='Experience the wonders of Shije Shothi, the beautiful and abundant Jeweled Market, called the Dream Bazaar. Multiple RP vignettes including a bustling Marketplace with reservable stage (contact the owner, @TheJulesKing, so they can get rid of the pesky Ma\\'iq for you), a peaceful Moongate Garden Courtyard just off the Temple Square, and outside the gates the Savannah...beyond which is an Oasis Beach ready for a romantic picnic or in the distance a Swimming Area with Changing Rooms and Cabanas!',['N']='Shije Shothi',},[75]={['C']=1.007000,['O']=19511,['D']='The Clanforge is a small northern coastal port most notable for its impressive forge, not to mention The Orsimer Arms Public House. Luxurious chambers await in the clanhouse, and off to one side you can follow the mine tunnel up to a primitive lake encampment. Perfect for small clan RP. Enjoy.',['N']='Wrothgar Village',},[92]={['C']=1.007000,['O']=19467,['D']='The Palazzio is the stuff of dreams, a jewel in Fargrave far from prying eyes. The courtyards, the libraries, the whiff of magic everywhere.',['N']='Fargrave Manor',},[7]={['C']=1.007000,['O']=19472,['D']='Eilean Draìocht is a druid isle paradise. Featuring full Circles for each: a Stonelore Henge, an Eldertide coral reef, and a Firesong pit in the undercroft. With plenty of mooring options including a tidy smuggler\\'s cove with floating dock for parties, to the \"Golden Lantern,\" a quaint pub located on the first floor of the lighthouse that features an intimate stage for poetry, minstrels, comedy. The second floor hosts a small ballroom with stage for musicians, and a romantic space above. ',['N']='Black Vine House',},[46]={['C']=1.007000,['O']=19497,['D']='The Mother\\'s Palace is open to all who enter, as Her arms are open to all in need. This Imperial Style palace has extensive and colorful floral walking gardens, as well as a grand open-air shrine to Dibella and a small chapel to the Eight Divines. A library, office, ballroom with stage, and pub are just a few of the many vignettes available.',['N']='The Mother\\'s Palace',},[91]={['C']=1.007000,['O']=19467,['D']='Welcome to the Leyawiin Adventure Society Social Club and Baths, a private membership (open to public RP) adventurers\\' club featuring dining and conversation space, a Hunter\\'s Pub, and a great collection of treasures and trophies from around Nirn. ',['N']='Adv. Society Club',},},['TS']=1685830226,['Version']=1773,}"
