R["oh__@mercadia.millithor"]="{['Version']=1773,['TS']=1683997876,['na']={[32]={['D']='With King Bazrag\\'s ascension to the throne of Orsinium, trade to Wrothar is booming!  Sensing an opportunity, Fezez and his friends have opened a waystation catering to the needs of weary travellers.\\r\\n\\r\\nLocated just east of the only pass through Wrothgar\\'s mountains, this refurbished keep offers worktables for on the road repairs, home cooked meals, soft beds, and more!\\r\\n\\r\\nUnburden your pack at Fezez\\'s!',['C']=1.026000,['O']=19490,['N']='Halcyon House',},},}"
