R["oh__@bigkylelad"]="{['eu']={[16]={['D']='A little paints and artwork shop in Daggerfall',['N']='Daggerfall Paints',['O']=19484,['C']=1.041000,},[81]={['D']='\"hmmm? what? Can\\'t you read the sign? It\\'s exactly what you think it is... A lore museum. No i\\'m not going to give you a history lesson, go inside for that. Ysmir\\'s hairy arse, i\\'m a guard, I don\\'t get paid enough for this.\"',['N']='Lore Museum',['O']=19483,['C']=1.030000,},[68]={['D']='\"Perhaps during the planemeld, tiny pieces of Coldharbour and Nirn swapped places? Oh Arkay\\'s beard, I don\\'t know. What I do know is that there\\'s an angry scamp in there with...is that gold?\"',['N']='Scamp\\'s Hoard',['O']=19484,['C']=1.043000,},[86]={['D']='Vorellian is a name the Psijics want struck from history, and for good reason. In an attempt to gain absolute mastery of lightning magic through any means necessary, Vorellian was banished from the Psijic order due to his cruel and unspeakable methods. Now what\\'s left of his fury and unwavering persuit of knowledge resides in the ancient ruin only known to outsiders as Varlaisvea but to Vorellian, it is his path to ascension, his near infinite well of power, his...rebirth. ',['N']='Vorellian\\'s Rebirth',['O']=19483,['C']=1.026000,},[72]={['D']='Dedicated to some friends that don\\'t play/ dont play much eso anymore. Styled to fit their personalities and what they liked in the game.',['N']='Hall of Dark Legends',['O']=19483,['C']=1.029000,},[17]={['D']='A suitable place for a weary adventurer',['N']='Adventurer\\'s Rest',['O']=19484,['C']=1.051000,},[43]={['D']='\"The Lake Lodge? Yes, this one knows of the place. R\\'ishkargi heard it was taken over by a wealthy dunmer and was made into an inn!\"\\r\\n\\r\\n\"Well i\\'m never going in there. It seems pleasant sure, but I swear i heard bats and screeching from inside one night, something\\'s not right with that place; Z\\'en protect me.\"\\r\\n\\r\\n\"Hah! Have you stolen this one\\'s skoo- ah... moon sugar biscuits? You look like you have seen an angry Senche-Raht! heh...you sound quite mad to R\\'ishkargi...\"',['N']='Vampire-owned inn',['O']=19484,['C']=1.038000,},[77]={['D']='A tiny pet store in Solitude, specialising in snakes.',['N']='Snek Shop',['O']=19483,['C']=1.041000,},[13]={['D']='Day 18 - Fredas 5th Frost Fall\\n    Tharayya told me to forget about it, but this is to big to pass up on. It\\'s a pristine Dwemer ruin for Mara\\'s sake. Why would she make such an amazing find and choose to leave it? Something\\'s not right.\\n\\nDay 21 - Morndas 8th Frost Fall\\n    I can\\'t keep my hands steady as I write this. The constructs are building something. Something... sinister. They know i\\'m here. They... command me. The gears turn. Must assist them. Steam hisses. Kagrenac\\'s vision. Numidium.',['C']=1.026000,['O']=19490,['N']='The Minidium',},[62]={['D']='Visit this masterpiece and you too can learn to never touch grass',['N']='BigKyle\\'s Flex House',['O']=19484,['C']=1.011000,},[49]={['D']='As the threat of vampires in Western Skyrim rises, a small, out of the way witch hut has drawn unwanted attention and scared off many a traveller who dares to get near it. It appears the witch inside  belongs to the Icereach coven and is conducting malevolent experiments to aid the Grey Host.',['N']='Icereach Witch Hut',['O']=19483,['C']=1.038000,},},['Key']='oh__@bigkylelad',['Version']=1773,['TS']=1683992191,}"
