R["fx__eu__@sulthepurplewitch__44"]="{['TS']=1680895873,['Effects']={[1]={['Pitch']=0,['Z']=77457.689060,['SizeZ']=309,['Yaw']=1.960000,['X']=38627.315280,['SizeX']=94,['Roll']=0,['Y']=5851,['Contrast']=1,['Id']=1044,['Color']=999998,['Alpha']=1,['SizeY']=309,['EffectType']=4547,['Groups']=0,},[2]={['X']=43494.461060,['Pitch']=0,['Groups']=0,['SizeZ']=759,['Yaw']=4.928810,['Contrast']=1,['SizeX']=474,['Roll']=0,['Y']=12749,['EffectType']=4500,['SizeY']=759,['Id']=1046,['Alpha']=1,['MetaData']={['houseid']=18,['owner']='@SuffragetteWin',},['Color']=999998,['Z']=79719.576779,},[3]={['X']=41203.228761,['Pitch']=4.712564,['Groups']=0,['SizeZ']=30,['Yaw']=3.141593,['Contrast']=1,['SizeX']=26.456456,['Roll']=0,['Y']=12822,['EffectType']=8502,['SizeY']=30,['Id']=1049,['Alpha']=1,['MetaData']={['message']='My dear reader, let me take you on a journey to the town of Gnisis to tell you the story of Madam Sul, a master enchantress and trader. Her reputation precedes her, sought after by powerful mages and wealthy merchants alike for her skill in crafting magical items and shrewd business acumen. I was fortunate enough to visit her abode, a sight to behold.\\n\\nAs you approach Madam Sul\\'s house, its walls pulse with magic and vitality. It seems to breathe and have a soul. It is said it was enchanted with the essence of a giant insect native to the region. Inside, the air is heavy with exotic spices and incense, inviting exploration. The house is filled with trinkets and treasures from all over Tamriel, each with its own unique story. Her collection of magical objects is second to none, and she delights in showing off her treasures to those lucky enough to visit. And her study is filled with books detailing the intricacies of the magical arts.\\n\\nOnly the most trusted visitors are permitted to her personal room, while others may explore the nooks and crannies of her house and come across a mysterious mirror, leading to another realm. If you\\'re lucky, you might even catch a glimpse of a shadowy figure darting in and out of it, a clue to what lies beyond. And if you listen closely, you might hear whispers of something darker. A shrine to Mephala, goddess of secrets, granting great gifts but at a steep price to those who pray at it, was carefully hidden away by the previous house owner.\\n\\nMadam Sul\\'s house is not just a place of mystery and arcane knowledge, but also a hub of magic trade and commerce. Her yard is stocked with crates of goods from all over Tamriel. She is a trader with a silver tongue to match, and visitors can leave her home with lighter pockets and fuller hearts...',['title']='Fantastic Houses & Who Live in Them Ch. 11',},['Color']=53373,['Z']=79973.415065,},[4]={['Pitch']=0,['Z']=78240.486636,['SizeZ']=60,['Yaw']=2.094395,['X']=37922.836333,['SizeX']=29.224138,['Roll']=0,['Y']=4555,['Contrast']=1,['Id']=1055,['Color']=999999,['Alpha']=1,['SizeY']=60,['EffectType']=5051,['Groups']=0,},[5]={['Pitch']=4.722861,['Groups']=0,['Color']=999999,['Yaw']=2.167699,['Z']=78798.810468,['SizeX']=4.352645,['Roll']=0,['Id']=1057,['EffectType']=5096,['Contrast']=1,['SizeZ']=16,['Alpha']=1,['SizeY']=16,['Y']=4670,['X']=38090.819496,},[6]={['Pitch']=4.712564,['Groups']=0,['Color']=999999,['Yaw']=2.370157,['Z']=78794.256525,['SizeX']=4.352645,['Roll']=0,['Id']=1058,['EffectType']=5096,['Contrast']=1,['SizeZ']=16,['Alpha']=1,['SizeY']=16,['Y']=4671,['X']=38090.643180,},},['Version']=1773,}"
