R["fx__na__@synaryn__58"]="{['Version']=1765,['TS']=1651510267,['Effects']={[1]={['Pitch']=5.497787,['Z']=23661.613138,['Groups']=0,['Yaw']=0.087266,['X']=26408.392016,['EffectType']=8503,['Contrast']=1,['Alpha']=1,['SizeZ']=30,['Id']=1009,['Roll']=0,['MetaData']={['title']='A letter from home',['message']='Mivanu,\\n\\nI pray your studies go well, I remember hating my Inter-House Case Law classes as well, the legal arguments are dry enough to make you fall asleep and that\\'s without even getting into your hag of a teacher. Your brothers and I prepared this care package so you would have a little piece of Balmora with you so far away from us. The corkbulb mini cakes should still be good by the time they get there, and the kwama cuttle candles will last for weeks so they\\'re perfect for long studying sessions. Mavis snuck in some sketches he did of when you were all last together, and Voryn whipped up a spell to preserve a bundle of coda flowers to cheer you up. They\\'ll make a nice offering to a shrine of Lord Vivec. You\\'ve always been a big learner, keep listening to your teachers, and you\\'re well on your way to being a fine lawyer. Don\\'t forget to feed Nereld in between all the homework, you know how your cousin\\'s netch jelly died because he could never remember to feed it!\\n\\n- Your proud father',},['SizeY']=30,['Color']=464698,['Y']=37884,['SizeX']=26.456456,},},}"
R["oh__@synaryn"]="{['Version']=1765,['TS']=1651510268,['Key']='oh__@synaryn',['na']={[19]={['C']=1.007000,['D']='A Dunmeri alchemist shop ICly located in the Mournhold Grand Bazaar, ran by Redoran Velsi Llaren Severin. The shop boasts potions and reagents for every possible use, books on introductory magic, and services for healing ranging form the immediate to the long-term. It also displays the minor relic Olmsblade, won by Velsi in a guar jousting competition.',['O']=18927,['N']='The Elixirium',},[49]={['C']=1.025000,['D']='A library dedicated to Saint Delyn sequestered in a cave off of Azura\\'s Coast in Vvardenfell, open for any in earnest search of learning. The strange mushrooms   propagate spores that keep the books as fresh as they were printed, but the engravings found around the cave warn against taking the books outside, as knowledge is best kept under the watchful eyes of the teachers.',['O']=18927,['N']='Library of St Delyn',},[58]={['O']=19114,['N']='Necrom Apartment',},[71]={['C']=1.007000,['O']=19082,['D']='The Selfora Community Health Center nestled in the holy Hortator\\'s Landing glade is now open to the public. \\n\\nThe gymnasium features weight lifting, gymnastics equipment, practice dummies, a sparring ring, and an archery range. \\n\\nThe bathhouse has a fully stocked lounge, a hot tub room, and a sauna. \\n\\nAfter you are done working out in the gymnasium and cooling off in the bath, reflect on the ancestors in the meditation garden to the side of the bathhouse. \\n\\nFeel free to use for RP!',['N']='Hortator\\'s Landing',},},}"
