R["fx__na__@synaryn__71"]="{['TS']=1648758967,['Effects']={[1]={['Id']=1005,['SizeZ']=100,['Roll']=0,['Groups']=0,['Pitch']=0.010472,['Yaw']=0.024435,['Color']=848484,['Y']=0,['SizeX']=100,['EffectType']=526,['Contrast']=4,['X']=0,['Z']=0,['Alpha']=1,['SizeY']=100,},[2]={['Id']=1006,['SizeZ']=4101,['Roll']=0,['Groups']=0,['Pitch']=0,['Yaw']=0.568977,['Color']=292700,['Y']=28864,['SizeX']=1507,['EffectType']=9,['Contrast']=1,['X']=76106,['Z']=58036,['Alpha']=0,['SizeY']=4101,},[3]={['Id']=1007,['SizeZ']=30,['Roll']=0,['Groups']=0,['Y']=28982,['Z']=58938.723817,['Yaw']=4.712389,['Color']=48,['MetaData']={['message']='Rules\\nA target number (most often 36) was agreed upon by the players. They would then take bets on who would reach the target number first, and sometimes these bets were modified if the target was reached by a certain number of rolls.\\n\\nThe game was played in turns. On their turn, each player would shake the dice within the scalped skull and pour them onto the top of the other skull. All dice must hit the skull and land on the cloth. If they did not, they had to be shaken and poured again.\\n\\nAfter a valid roll, the value of the dice was added to the players running total. If the player rolled doubles, he or she could instead reroll one or both of the dice. If triples or quadruples were rolled, he or she could instead roll all three or four of the dice, respectively. If all five dice showed the same number, that player won the game instantly.\\n\\nOne had to reach the target number exactly. The first time that a player exceeded the target number, he or she immediately rerolled all five dice and subtracted their value from his or her running total. On every turn after that, such players could only roll one die, and if they ever exceeded the target value again, that roll was simply ignored.',['title']='Heretic\\'s Heads Rulebook',},['SizeX']=26.456456,['EffectType']=8503,['Contrast']=1.020000,['X']=76855.934498,['Pitch']=4.712564,['Alpha']=1,['SizeY']=30,},[4]={['Id']=1010,['SizeZ']=90,['Roll']=0,['Groups']=0,['Y']=29310,['Z']=63307.785268,['Yaw']=0.439823,['Color']=131658,['MetaData']={['message']='1. Put the weights back after using them.\\n2. Never lift without a spotter.\\n3. Sparring is SPARRING, non-lethal attacks and weapons only!\\n4. Clean the equipment after you\\'re done using it.\\n5. Shoes are required! Towel dry off after workout.\\n6. Do not eat on the equipment, only on the resting couches.\\n7. Be respectful of others, getting in their way puts you and them in danger.\\n8. The water fountain is not a jungle gym for children.\\n9. Do not walk into the archery range while someone is shooting.\\n10. Immediately report any broken or damaged equipment and turn them in for collection.\\n11. The gymnasium is closed except for spectating while an honor duel is occuring.\\n\\nHONOR DUEL RULES:\\n1. All petitions for honor duels must be filed with the House Severin Elder Conclave.\\n2. Terms of the duel (non-lethal or no, first blood or yield) MUST be settled before the duel occurs.\\n3. The gymnasium does not provide equipment for honor duels.\\n4. Spectators are allowed provided they remain quiet and do not interfere with the results of the duel.\\n5. Wagering on the results of the duel within the gymnasium is not permitted.',['title']='Gymnasium Rules',},['SizeX']=86.456456,['EffectType']=8503,['Contrast']=1,['X']=68919.186243,['Pitch']=6.279695,['Alpha']=1,['SizeY']=90,},[5]={['Id']=1011,['SizeZ']=30,['Roll']=0,['Groups']=0,['Y']=29068,['Z']=55681.521069,['Yaw']=4.705408,['Color']=155423,['MetaData']={['message']='Scathecraw was the loyal steed of Indoril Volmyna Severin, House Brother of Great House Indoril and Disciple of Almalexia. The Honored Steed, First Sire of the Great Line of Scathecraw Guar which serve House Severin to this day, carried Disciple Volmyna across the Sacred East to move the ashes of Indoril Maros Severin, the Vassal House\\'s Seneschal at the time. \\n\\nScathecraw perished due to exhaustion when they arrived at Necrom, and so he underwent the rites of cremation and his skull was moved to Selfora as a reminder to always push forward. The guar\\'s spirit is bound to the land of Hortator\\'s Landing, protecting and empowering all who tread upon the sacred ground.',['title']='Scathecraw, Guardian Spirit of Hortator\\'s Landing',},['SizeX']=25.456456,['EffectType']=8503,['Contrast']=1,['X']=73214.026915,['Pitch']=4.593707,['Alpha']=1,['SizeY']=30,},[6]={['Id']=1012,['SizeZ']=30,['Roll']=0,['Groups']=0,['Y']=29139,['Z']=57345.160872,['Yaw']=6.129596,['Color']=428298,['MetaData']={['message']='\"The Hortator was still trying to subdue the heavens with an axe. He was thrown out of the library of the sun by the power of Magnus. Vivec found him in a grub field outside of the swamps of the Deshaan Plain. They walked for a span in silence, for Nerevar had been humbled and Vivec still had mercy in his hand.\\n\\nSoon they were walking across the eastern sea to the land of snakes and snow demons. Vivec wanted to show the Hortator the fighting styles of foreign tongues. They learned the idiom stroke from the pillow book of the Tsaesci king. It is shaped like the insight of this page. The Tsaesci serpents vowed to have their vengeance on the west at least three times.\\n\\nThey walked farther and saw the spiked waters at the edge of the map. Here the spirit of limitation gifted them with a spoke and bade them find the rest of the wheel.\\n\\nThe Hortator said, \\'The edge of the world is made of swords.\\'\\n\\nVivec corrected him. \\'They are the bottom row of the world\\'s teeth.\\'\" - The 36 Lessons of Vivec, Sermon 17, 4:16.\\n\\nRumored to be the very glade where Vivec found the Hortator after he was thrown from the sun\\'s library, the Hortator\\'s Landing is an especially blessed site in the pilgrim town of Selfora. The Eidolon River\\'s waters are enhanced with healing properties upon flowing through this sacred ground, with many finding relief from long-held pains both physical and spiritual after bathing in the waters. As homage to the legend, a glowing statue of Vivec stands over the bathhouse, watching all who enter. The statue of Volmyna Severin, an honored Disciple of Almalexia, stands solemn guard against any who would intrude upon holy territory. ',['title']='Hortator\\'s Landing',},['SizeX']=26.456456,['EffectType']=8503,['Contrast']=1,['X']=74756.597179,['Pitch']=6.108652,['Alpha']=1,['SizeY']=30,},},['Version']=1765,}"
