R["fx__eu__@bloodyhime__18"]="{['TS']=1635708447,['Effects']={[1]={['Id']=1138,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=8323,['Alpha']=1,['Z']=73671.338882,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte II, scène 5',['message']='Quelqu\\'un frappe à la porte.\\nLa Comptesse : \"Entrez !\"\\nLa domestique entre avec un plateau entre les mains : \"Votre courrier est arrivé.\"\\nLa Comptesse : \"Posez-le sur mon bureau, près du chandelier.\"\\nLa comptesse parcourt son courrier. Elle se lève d\\'un bond.\\n\"Mademoiselle, aller immédiatement me chercher le jardinier ! Dites-lui que c\\'est au sujet des roses. Il comprendra, dépèchez-vous !\"\\nLa domestique quitte la pièce précipitamment.\\nLa comptesse met sa tête dans ses mains et retombe sur sa chaise :\\n\"Enfin... Enfin, je vais pouvoir dévoiler le coupable !\"',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=67306.182929,['Yaw']=4.712389,},[2]={['Id']=1139,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=8443,['Alpha']=1,['Z']=73685.073846,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte I, scène 3',['message']='Dans la salle à manger, en fin de matinée. La Comptesse tend une assiette de gâteau à son invité.\\nMadame la Comptesse : \"Docteur, comprenez-moi, comment voulez-vous que je dorme dans cette situation ? Quelqu\\'un tue mes domestiques. Je me suis battue pour les libérer et leur proposer de rester à mon service. Ce n\\'est pas pour les voir disparaître les uns après les autres. Je ne dormirais pas tant que je n\\'aurais pas mis la main sur le coupable.\"\\nLa Comptesse saisit une olive et se perd dans ses pensées.',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=67255.465346,['Yaw']=4.625123,},[3]={['Id']=1140,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=7823,['Alpha']=1,['Z']=73212.930334,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte I, scène I',['message']='Dans le jardin, un matin ensoleillé.\\nLe jardinier entre et se dirige vers les parterres de fleurs. Il s\\'accroupit auprès des pervenches, et arrête son geste. Il sort un poignard dégoulinant de sang aussi noir que de l\\'encre. Une mare rouge sort du parterre et commence à s\\'étaler. \\nAvec panique, le jardinier crie : \"Madame ! Madame ! Madame !\"\\nIl sort et se dirige vers le salon en courant.',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=68100.263396,['Yaw']=0,},[4]={['Id']=1141,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=7763,['Alpha']=1,['Z']=72966.962091,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte III, scène 4',['message']='Dans la librairie. Le crépuscule teinte la pièce de rouge.\\nLe jardinier : \"Ca suffit, la moutarde me monte au nez ! Soi-disant parce que j\\'ai trouvé le corps de la première domestique, je serais le coupable ! Vous n\\'avez aucune preuve, monsieur ! J\\'ai aidé Madame la Comptesse depuis le tout début de cette histoire !\"\\nLa comptesse : \"Colonel, rasseyez-vous. Mon jardinier a raison, vous n\\'avez pas de preuve pour l\\'incriminer. Et je peux vous démontrer son innocence. Cependant, vous avez raison sur un point, il n\\'a pas été tout à fait honnête avec nous. Vous nous cachez une part de la vérité, n\\'est-ce pas ? Dois-je l\\'annoncer ou le feriez-vous, vous-même ?\"',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=68107.977771,['Yaw']=0.087266,},[5]={['Id']=1142,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=7763,['Alpha']=1,['Z']=72883.233824,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte I, scène 6',['message']='Dans le jardin, sous un kiosque. Il pleut.\\nUne domestique arrive en courant.\\nLa domestique : \"Madame la Comptesse ! Madame la Comptesse !\"\\nLa Comptesse : \"Que se passe-t-il ? Que signifie cette agitation ?\"\\nLa domestique :  \"Nous avons retrouvé le professeur ! Il était étendu sur le tapis à l\\'entrée ! Et il tenait cette enveloppe violette dans son poing.\"\\nLa comptesse saisit l\\'enveloppe : \"Où se trouve-t-il actuellement ?\"\\nLa domestique : \"Nous l\\'avons allongé sur le canapé du grand salon.\"\\nLa Comptesse : \"Allez chercher le docteur. Je vais de ce pas retrouver le professeur. Peut-être nous apportera-t-il des réponses.\"\\nElles quittent la scène.',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=68092.544713,['Yaw']=0.087266,},[6]={['Id']=1143,['EffectType']=8502,['Color']=102439,['SizeX']=26.456456,['Y']=7823,['Alpha']=1,['Z']=72767.479562,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='Acte II, scène 1',['message']='Dans le grand salon, près de la cheminée.\\nLe professeur est allongé sur la canapé. Seul le docteur, la Comptesse et une domestique se trouvent dans la pièce.\\nLa Comptesse : \"Alors docteur ? Quel est son état ?\"\\nLe docteur : \"Il est hors de danger. Le blanc de ses yeux prouve qu\\'il a seulement été assomé. Il est faible parce qu\\'il n\\'a pas dû manger depuis sa disparition. Du repos et de la nourriture devrait lui permettre de reprendre des forces, madame la Comptesse.\"\\nLa Comptesse : \"Je vous remercie, nous veillerons à ce qu\\'il puisse se remettre sur pied. Mademoiselle, veuillez servir le repas pour le professeur en utilisant le service de ce vaisselier.\"\\nLa domestique : \"Bien, madame la Comptesse. Le repas sera prêt dans 20 minutes.\"\\nLa domestique quitte la pièce.',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=68087.002101,['Yaw']=0.087266,},[7]={['Alpha']=1,['EffectType']=4556,['Yaw']=4.712389,['Y']=7250,['SizeX']=600,['Id']=1144,['Z']=74212,['Contrast']=1,['Pitch']=0,['Groups']=0,['SizeY']=600,['Color']=996863,['Roll']=0,['X']=67170,['SizeZ']=600,},[8]={['Id']=1160,['EffectType']=1012,['Color']=999999,['SizeX']=1,['Y']=7160,['Alpha']=1,['Z']=74064,['SizeZ']=1,['Contrast']=1,['MetaData']={['is']='Off',['when furniture']='4805595970706787167',['target effect']=1144,},['Pitch']=0,['Groups']=0,['SizeY']=1,['Roll']=0,['X']=66564,['Yaw']=4.712389,},[9]={['Id']=1164,['EffectType']=8503,['Color']=102439,['SizeX']=26.456456,['Y']=7210,['Alpha']=1,['Z']=74197.536427,['SizeZ']=30,['Contrast']=1,['MetaData']={['title']='  ',['message']='Quelle est la couleur de la nuit ?',},['Pitch']=0,['Groups']=0,['SizeY']=30,['Roll']=0,['X']=67204.563322,['Yaw']=4.712389,},},['Version']=1765,}"
R["fx__eu__@unlockman__16"]="{['Effects']={[1]={['EffectType']=8501,['Alpha']=0,['Pitch']=3.141767,['Yaw']=4.188790,['Y']=20166,['Z']=28504.064229,['Id']=1031,['SizeZ']=30,['MetaData']={['message']='Notes on what Shadow Magic may achieve\\n\\n\\n\\n... chosen to explore this relation of world to shadow, Azra was the first to realize that shadows were not a mere absence of light but a reflection of possible worlds created by forces in conflict. A light strikes a rock, and the shadow is a record of their clash, past, present and future.\\n\\nOther conflicting forces produced less obvious shadows, fire and water, wind and rock, or nations at war.\\n\\nWith skill and patience, the shadows of all could be read, and patterns teased out, emphasized or eradicated.\\n\\nManipulating a shadow could, through contagion, manipulate the object or force which cast it.\\n\\n',['title']=' First Scroll of Shadow\\n',},['Color']=102439,['SizeY']=30,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=18852.248039,['SizeX']=26.456456,},[2]={['Alpha']=0.160000,['Pitch']=0,['EffectType']=31,['SizeY']=1,['Yaw']=5.106833,['Z']=28093.455904,['Id']=1033,['SizeZ']=1000,['Color']=30099,['Y']=20029,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=19566.353221,['SizeX']=1000,},[3]={['Alpha']=1,['Pitch']=0,['EffectType']=499,['SizeY']=2400,['Yaw']=0.785398,['Z']=28449,['Id']=1035,['SizeZ']=2400,['Color']=474847,['Y']=20566,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=19794,['SizeX']=4000,},[4]={['Alpha']=1,['Pitch']=0,['EffectType']=499,['SizeY']=2400,['Yaw']=0.785398,['Z']=28449,['Id']=1036,['SizeZ']=2400,['Color']=474847,['Y']=20106,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=19794,['SizeX']=4000,},[5]={['EffectType']=8502,['Alpha']=0,['Pitch']=0,['Yaw']=4.188790,['Y']=20221,['Z']=28532.350126,['Id']=1042,['SizeZ']=30,['MetaData']={['message']='On the coldest night of Evening Star, we have heard screams from Breton settlement nearby. The entire settlement was surrounded by fog...it was so strangely dense. We could not see what´s happening, but the piercing screams were enough to not allow anyone to sleep. The next morning I rallied a small group and we rode to the settlement. The closer we got, the denser fog was becoming. The morning was cold, especially this early, strangeness of it, area of settlement was noticeably colder. Like in the rest of High Rock there was no snow. However, the amount of hoarfrost was bigger than usual. But worst of all... \\n\\n\\nBodies. Entire village slaughtered, people with missing limbs, with missing hand, people butchered so badly that they looked more like pile of shit than men. Some didn´t have single cut or bruise, rather froze to death...horrors they witnessed could have been seen in their faces just the same. \\n\\nWhat connected them all was coldness, even the ones that didn´t freeze had their wounds covered with hoarfrost. Blood on ground was frozen, even blood on their wounds was frozen. \\n\\n\\nWe started placing bodies on a pile and as we were doing that we heard quiet cry. a child´s cry. It was a little girl, hiding in a basket in one of the houses. She was in shock, shaking and crying. We couldn´t get a single word from her. Because she was very cold I gave her my coat and we rode back. At home, she got warm soup. After while she started talking. I will try to write down exactly what she said. \\n\\n',['title']='Cold Night part I',},['Color']=919973,['SizeY']=30,['Groups']=0,['Contrast']=3.560000,['Roll']=0,['X']=18910.521810,['SizeX']=26.456456,},[6]={['EffectType']=8502,['Alpha']=0,['Pitch']=0,['Yaw']=4.188790,['Y']=20270,['Z']=28532.350126,['Id']=1043,['SizeZ']=30,['MetaData']={['message']='After the sun went down everyone went to their homes. Resting, sitting by fire, telling tales to their kids. Air was getting colder, not by hours but by minutes. Soon, inside the house was as cold as outside usually is. Her parents looked out of a window. Dense mist, sneaking closer and closer until all of the settlement was covered. All of the village went silent, waiting for what to come. \\n\\nFrom afar clapping of horseshoes could be heard. Louder and louder. Then rattling of metal armor as riders we dismounting. Riders were coming closer to houses...but they never knocked.\\n\\nWith first scream, her mother hid her in the larger basket. Her father was moving a wardrobe to barricade the doors. It was too late. Loud hit echoed. The door opened widely. From basket she heard scream of her father, then swing of a heavy metal object. In blink of eye, her mother was hushed... but the heavy footstep remained. Searching the houses, searching for any survivors.\\n\\nShe peeked through a gap in the basket. It was a tall person. He had black face. Little horns in line, on top of the head. Empty eye sockets. Raven nose, pointing down. In place of mouth was just empty brighter space. Wearing heavy armor in shades of grey and black.\\n\\nHe was searching. For her. One of them called him. It was a deep firm voice. She saw him too. He had a skull for face. Two Horns on the sides of his head. His armor looked heavy as well. But it was more spiked. As soon as the faceless person heard the voice, he went outside, not returning. The girl stayed in the basket for rest of the night, until morning when we found her.\\n\\n\\n',['title']='Cold Night part II',},['Color']=919973,['SizeY']=30,['Groups']=0,['Contrast']=3.560000,['Roll']=0,['X']=18910.521810,['SizeX']=26.456456,},[7]={['EffectType']=8503,['Alpha']=0,['Pitch']=0,['Yaw']=5.759587,['Y']=20248,['Z']=28177.920538,['Id']=1045,['SizeZ']=30,['MetaData']={['message']=' Frostfall 24 2E 608\\n\\n\\n\\nOld gate 4 Daggerfall\\n\\n\\nThis paper allows it´s wielder, Baralyn Derone, all rights to conduct experiments on grounds of Captain Margaux\\'s place, street Old gate 4. Subject of agreement does not involve conducting experiments on humans, nor domestic animals. As such owner is still responsible to harm that may come to humans or domestic animals. Agreed upon by King´s council\\n\\n\\nSignature:\\n\\nGennove LaRoucher \\n\\n',['title']='Permission to conduct experiments',},['Color']=102439,['SizeY']=30,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=20449.643720,['SizeX']=26.456456,},[8]={['EffectType']=4402,['Alpha']=1,['Pitch']=1.570971,['Yaw']=2.188643,['Y']=20526,['Z']=28276.887448,['Id']=1047,['SizeZ']=8,['MetaData']={['message']='x',},['Color']=23,['SizeY']=8,['Groups']=0,['Contrast']=1,['Roll']=0,['X']=20335.267651,['SizeX']=6,},},['Version']=1762,['TS']=1635095782,}"
R["fx__eu__@unlockman__8"]="{['Effects']={[1]={['Id']=1024,['Color']=0,['Z']=23778.178312,['Y']=20713,['Contrast']=1,['EffectType']=12,['SizeZ']=900,['SizeX']=700,['Yaw']=1.570796,['Alpha']=1,['Groups']=0,['Pitch']=4.712564,['SizeY']=900,['X']=22976.268053,['Roll']=0,},[2]={['Roll']=0,['MetaData']={['message']='It all started few weeks after recovering the blade. I started having dreams about the place. At first, I thought it´s some kind of...how would I call it?... post-event impact.\\n\\n I was used to that. Prior to events which started it all, I somehow got myself captured into sort of void. When I woke up I couldn´t remember a single thing that happened. Others told me I appeared as sort of shadow of myself. Somehow I lived through my fears. But to cut it short when I tried to sleep after coming back from the void, I had the exact same dreams as others described. \\n\\nSo I thought this is same case. Later I haven´t had dreams only about a place we visited, but about different parts of Evergloam. That made me think differently, since then I am searching for answers. \\n\\n\\n\\n\\n\\nThis is a first note I am writing in case something will go wrong. I might not need to, but who knows where this will end up. But hey, for now I am just sitting by campfire still alive.\\n\\n\\n\\n',['title']='Lock´s notes 1',},['SizeY']=30,['Groups']=0,['Y']=20128,['Yaw']=2.879793,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=4.974188,['Alpha']=0,['EffectType']=8502,['Z']=23161.502493,['X']=23414.037297,['Id']=1055,},[3]={['Roll']=0,['MetaData']={['message']='I haven´t written in while, everything was the same as the last time. I was traveling... I don´t even know how long, could have been days, could have been weeks. I was looking for any sign, but I am not even sure what I am looking for. \\n\\nAnyway, in the past few days, it has gotten worse. Now I am hearing a woman voice. But the voice doesn´t sound menacing at all, I´d say it even sound very friendly... I knew that voice, but until she said who she is herself, I was unsure. The way she acts, the way she speaks, it´s nothing like she spoke with brotherhood. She doesn´t want anything from me, not even worshipping her, she just...talks with me. It´s strange, but I am gonna play along... for now.\\n\\n',['title']='Lock´s notes 2',},['SizeY']=30,['Groups']=0,['Y']=20139,['Yaw']=3.141593,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=4.712564,['Alpha']=0,['EffectType']=8503,['Z']=23015.712575,['X']=22961.021316,['Id']=1056,},[4]={['Roll']=0,['MetaData']={['message']='I needed to know more, I had to find someone who has experience... so I started looking for any follower of hers, but nothing. Some say there is very little of them and are like shadows, but most say she doesn´t have followers. I have found books, where is said that she requires no worship, she makes deals. However, when I asked her, she confirmed she has some. She didn´t want to tell me tho...\\n\\nI have to be cautious, something´s not right. But it´s nice from time to time having dreams that don´t want to kill me or my friends.\\n\\n',['title']='Lock´s notes 3',},['SizeY']=30,['Groups']=0,['Y']=20058,['Yaw']=0.893609,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=4.712564,['Alpha']=0,['EffectType']=8501,['Z']=22704.609727,['X']=22788.781795,['Id']=1057,},[5]={['Roll']=0,['MetaData']={['message']='I think I have found a lead. There was a conjunction of Evergloam with some city called ´´Clockwork City´´. I haven´t heard of place, but sounds dwemerish. So my next stop is Morrowind or East Skyrim.\\n\\nIn Deshaan I found a scholar who knows of the place. I paid him and he led me deep under Mournhold. There was some sort of vault, he showed me way in. In vault there was a metal sphere, size of Breton, Imperial perhaps. Suddenly the scholar used some blinding magic on me. Before I could react I passed out.\\n\\nI woke up in the sphere, it was the Clockwork City. Clockwork City is under ground, in humanoid sized sphere, who would have thought. It´s very interesting city, there is not only the city itself but a piece of wilderness also. My first stop... city itself. People told me that rumors are true, but nothing that would be helpful. Suddenly Nocturnal started to saying more to me in dreams, almost in riddles but still. \\nHer words led me to a portal to Evergloam. But before I could step into the portal, I passed again. In my sleep, she has spoken again, telling me not to go yet. \\n\\nIt´s confusing, but I am kinda starting to trust her, she must have good reason after all.\\n\\n\\n\\n',['title']='Lock´s notes 4',},['SizeY']=30,['Groups']=0,['Y']=20371,['Yaw']=1.308997,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=0,['Alpha']=0,['EffectType']=8502,['Z']=23525.702609,['X']=22673.925827,['Id']=1058,},[6]={['Roll']=0,['MetaData']={['message']='Instead, she led me to an oil field. On the field there was nothing, but scrap and mechanic spiders. I was searching whole day. Finding nothing, until night when moonshine shined. Then I was something sparking. It was a blade.\\n\\nThe blade was shining coldly, laying half in the oil. There was body near is it, an altmer female body. Almost sunk in oil, just hood and face with stains of oil was not sunken yet. Hood and probably the rest of armor... if it can be considered one, from dark blue almost black silk. Soft, but hard enough, dark and cold. The sword was also cold like ice, dark but shiny. And sharp, unbelievably sharp. All this looked like brand new, like the female wore shadows. I couldn´t take suit as it was too damaged by oil, but I took the sword. When I fell asleep, Nocturnal spoke again, that sword was gift from her. But that wasn´t all... she offered me a deal. \\n\\n\\n\\nThe deal was like this: I would find a skeleton key and guard it here on Nirn, I for exchange I could use it from time to time.\\n\\nUnder normal circumstances I would say no. But now... I don´t know.\\n\\n',['title']='Lock´s notes 5',},['SizeY']=30,['Groups']=0,['Y']=20028,['Yaw']=0.959931,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=5.846853,['Alpha']=0,['EffectType']=8503,['Z']=21666.477745,['X']=23022.243555,['Id']=1059,},[7]={['Roll']=0,['MetaData']={['message']='I was thinking about it... a lot. I am pretty sure brothers and sisters would kill me for this, if they would find out... but if they are reading this now, means I am probably dead already. I know I shouldn´t take the deal...but deep inside I know I have to take it.\\n\\nI have met Aeriel few day ago, she is in worse state than I originally imagined. It´s like everything screams ´´do it´´.\\n\\nThe Mistress said it´s time to finally go into Evergloam, if I agree on deal. I have seen gateways to her realm in Clockwork City, hopefully I can build something similar. If I have succeeded and if someone is reading this means it has gone wrong. Means also don´t go near it, no matter what.\\n\\n',['title']='Lock´s notes 6',},['SizeY']=30,['Groups']=0,['Y']=20723,['Yaw']=3.490659,['SizeZ']=30,['Color']=102439,['SizeX']=26.456456,['Contrast']=1,['Pitch']=4.712564,['Alpha']=0,['EffectType']=8501,['Z']=23533.843840,['X']=23207.835665,['Id']=1060,},[8]={['Roll']=0,['EffectType']=4547,['SizeY']=162,['Y']=20714,['Yaw']=2.967060,['Alpha']=0,['Color']=999999,['SizeX']=340,['Contrast']=1,['Pitch']=0,['Groups']=0,['SizeZ']=162,['Z']=23810.025512,['X']=22988.719355,['Id']=1061,},},['TS']=1634491000,['Version']=1762,}"
