R["fx__eu__@thepsychoticaltmer__55"]="{['TS']=1632662852,['Version']=1760,['Effects']={[1]={['SizeY']=43,['Pitch']=4.974188,['Y']=50652,['MetaData']={['title']='STATION: ALCHEMY',['message']='3 PEOPLE MAX: \\n\\nThe Alchemy Station is used to create alchemical buffs and boons for the combat group.   \\n\\nCreating a potion is freeform: a single potion takes one turn (ATTACK/DEFENSE) to make. A basic potion requires NO ROLLS. After making a potion, you must skip a turn: for example if you make a potion during an attack roll, you cannot make another till the next attack roll. You may still emote, just follow it up with a (x): \"Char twiddled their thumbs (x)\"  \\n\\nThere are 4 basic recipes, and each individual potion can be critrolled to be improved into a \"+\" version (85):\\n\\n\\n\\n\\n\\n\\n-------------------------------------------------------------\\n\\nPOTION OF DAMAGE: kills a single normal enemy, 1 HP on a boss. \\n\\nPOTION OF DAMAGE +: kills an entire normal enemy wave, or does 2 HP damage to a boss.\\n\\n--------------------------------------------------------------\\n\\nPOTION OF SHIELDING: shields a single ally, preventing them from being damaged during a defense roll (shield lasts one turn).\\n\\nPOTION OF SHIELDING +: shields THREE people, of the alchemist\\'s choosing.\\n\\n--------------------------------------------------------------\\n\\nPOTION OF EMPOWER: Imbues a single ally with power, guaranteeing a successful hit on their next attack.\\n\\nPOTION OF EMPOWER +: A stronger mix that guarantees a CRITICAL hit on a single ally.\\n\\n--------------------------------------------------------------\\n\\nPOTION OF PANACEA: Heals a single target for 1 HP.\\n\\nPOTION OF PANACEA +: Heals every ally for 1HP',},['Yaw']=5.148721,['Alpha']=0,['Roll']=0,['Id']=1163,['SizeX']=106.456456,['Contrast']=1,['Color']=102439,['X']=46193.471904,['Z']=88664.221031,['Groups']=0,['SizeZ']=43,['EffectType']=8503,},[2]={['SizeY']=23,['EffectType']=8,['Y']=50706,['Pitch']=0,['Yaw']=4.712389,['Roll']=0,['Id']=1164,['SizeX']=122,['Contrast']=1.760000,['Color']=449398,['X']=46177.737372,['Z']=88688.836835,['Groups']=0,['SizeZ']=23,['Alpha']=1,},},}"
