R["fx__eu__@thepsychoticaltmer__80"]="{['TS']=1634508707,['Version']=1764,['Effects']={[1]={['Groups']=0,['SizeY']=30,['Y']=19595,['Pitch']=4.712564,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8503,['Yaw']=3.155555,['Contrast']=1,['X']=109441.568758,['Z']=107096.229413,['MetaData']={['title']='Instructions for Solvent Production',['message']='The Dwemer are proving remarkably resistant to force: those we have lashed and put against the rack remain ever as tight-lipped, and I suspect it will be many more weeks before we can break their collective will: the Calling is proving to be an interesting beast to crack. It seems the weaker links who would have otherwise given in to our questioning are given solace in a shared communication with others in the same predicament. It\\'s a miracle we managed to sever them as much as we did, otherwise it seems likely that our coup would have been reported to the other cities.\\n\\nRegardless, we managed to extract something: perhaps you and Gwenaine can put it to use?\\n\\nHere are a few of the recipes for making solvents. Do note that these are order-specific, so make sure they are made exactly as written. I don\\'t want a repeat of what happened at Moesring (and tell Gwenaine she still owes me a bottle of wine):\\n\\n--------------------------------------------------------------\\n\\n1 Green + 1 Red + 1 Blue = Generic Base\\n\\n1 Red + 2 Blue = Electric Compound\\n\\n1 Green + 1 Red + 1 Green = Acidic Compound (exercise caution)\\n\\n2 Blue + 1 Red + 1 Green = Frost Compound\\n\\n--------------------------------------------------------------\\n\\n- Knight-Paladin Aedir',},['SizeX']=26.456456,['Id']=1114,},[2]={['Groups']=0,['Y']=19609,['Pitch']=0,['Color']=993836,['Id']=1116,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=103776.635797,['X']=108830.760638,['SizeX']=97,['Yaw']=3.054326,},[3]={['Groups']=0,['SizeY']=30,['Y']=19631,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8503,['Yaw']=2.010619,['Contrast']=1,['X']=107256.533734,['Z']=104975.100212,['MetaData']={['title']='Notes on Extraction',['message']='*The writing here is strange. Everyone has a distinct way of writing: whether it be from the flowery, delicate verbage of an educated poet, or the rough-yet-warm penmanship of a commoner. There is none of that here: each letter is a uniform, soulless imprint upon the page which gives no clues as to anything regarding the author: man or woman, young or old, expert or novice. Not even a flicker of personality remains in the cold, hard etchings of fact upon this page*\\n\\n--------------------------------------------------------------\\n\\nON QUANTITY: We have a fairly limited stock, which posits a potential obstabcle: we cannot collect materials from the other Dwemeri city-states without compromising the nature of our control here, and we cannot leave this place without invoking the wrath of the Northern barbarians. Thus we must make do with the surplus readily available to us. \\n\\nIn order to ensure future viability, we must exercise prejudice in our selection process. We should limit our experiments to the older stock.\\n\\n--------------------------------------------------------------\\n\\nON QUALITY: Preliminary research indicates our materials will require a significant investment of time to replenish to a satisfactory quality. Whilst we have ran our tests on the debased stock, there will come a clear point where we will have plumbed their worth. \\n\\nPeak status is within the range of 18-21 years. Aedir has already begun creating more for our army, we will take the lesser scraps not fit for purpose. Until then, it is my suggestion that we limit our usage to a ratio of 1:4 with the variables being Week/Specimen.\\n\\nTo preserve longetivity, we will also limit monthly extraction limits to 1x10^5  (5 Barrels).\\n\\n---------------------------------------------------------------',},['SizeX']=26.456456,['Id']=1125,},[4]={['Groups']=0,['SizeY']=30,['Y']=19767,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['Yaw']=6.014405,['Contrast']=1,['X']=108692.189824,['Z']=104921.053398,['MetaData']={['title']='Locked Closet',['message']='A locked, brass closet. Like all things crafted with Dwemer metal, it shows very little signs of aging: even the lock itself is in perfect condition, allowing anyone with knowledge of Dwemer design or lockpicking to break in.\\n\\nROLLS: \\n\\n- 50+ to open\\n- Roll 3d4 for loot\\n\\n1-4 = Low-Tier\\n5-9 = Medium-Tier\\n10-11 = High-tier\\n12 = Legendary-tier',},['SizeX']=26.456456,['Id']=1127,},[5]={['Groups']=0,['Y']=19633,['Pitch']=0,['Color']=329939,['Id']=1128,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.810000,['Z']=104970.866313,['X']=107272.964275,['SizeX']=95,['Yaw']=3.054326,},[6]={['Groups']=0,['SizeY']=30,['Y']=19547,['Pitch']=1.570971,['Color']=102439,['Roll']=3.141767,['SizeZ']=30,['Alpha']=1,['EffectType']=8503,['Yaw']=2.007129,['Contrast']=1,['X']=107462.202930,['Z']=104245.410008,['MetaData']={['title']='Alchemical Rack',['message']='There are 4 vials sitting in the rack, each with a different liquid in varying hues from a deep, muted orange, to a pearly-white milk. They are labelled as follows, from top to bottom:\\n\\nCondensed Flame\\nTone-Altered Dwemeri Oil\\nEssence of Valeflower\\nCongealed Animus Paste',},['SizeX']=26.456456,['Id']=1129,},[7]={['Groups']=0,['SizeY']=30,['Y']=19545,['Pitch']=4.799655,['Color']=102439,['Roll']=3.141767,['SizeZ']=30,['Alpha']=1,['EffectType']=8503,['Yaw']=5.148721,['Contrast']=1,['X']=107434.163397,['Z']=104285.080176,['MetaData']={['title']='Ornate Phial',['message']='The phial is topped with silver: inlaid, intricate markings of eagles and snowflakes ring around in an exquisite show of craftsmanship and opulence. The glass is shimmering, iridescent viridian, and inside is a viscous material that adds a surprising weight to the phial if it is held in-hand. There is a single label: \\n\\n\"Fulminating Liquid Gold\"',},['SizeX']=26.456456,['Id']=1130,},[8]={['Groups']=0,['SizeY']=30,['Y']=19691,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8503,['Yaw']=1.752311,['Contrast']=1,['X']=107277.331219,['Z']=105029.047711,['MetaData']={['title']='On the Nature of Shadow',['message']='* This book is significantly worn out, with numerous page corners being bent over. There is even a bookmark still left inside. This book was read extensively, to the point of obsession*\\n\\n--------------------------------------------------------------\\n\\nA treatise written by Maraithbor, Senior Curate of the Chantry of Auri-El.\\n\\nIf you were to ask ten common Mer the question: \"What is a shadow?\", you\\'d get 50 answers back.\\n\\nTo some, it is a source of terror: how many of our people fear the foul creatures of the night, or petty banditry from the lesser of our kin? for some unscrupulous Falmer, it is a source of opportunity: a way to hide, a place to plot and a means of secrecy. A child fears the shadow under their bed, just as two forbidden lovers crave the unjudging privacy of shadow.\\n\\nTake me, for example. I write this on the eve of my 400th year, wizened and grey. If you saw me under Auri-El\\'s light, you\\'d see me in all my weakness, my fragility. At night, under shadow, that would not be the case: I could easily be some lumbering, vicious bandit.\\n\\nThat is the power of shadow: the great Nothingness that erases all. It is the \"maybe\" from which all things come: the Aurbis, Nirn, Magicka, the Ada, and it is only by the great sacrifice and blessing of our Ancestor-spirits that we resist such chaos. Shadow is is anathema to Auri-El, and as such, we must treat all users of such arts with the retribution they deserve as heretics. ',},['SizeX']=26.456456,['Id']=1131,},[9]={['Groups']=0,['SizeY']=30,['Y']=19568,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8501,['Yaw']=2.453933,['Contrast']=1,['X']=107922.941926,['Z']=103002.725424,['MetaData']={['title']='Soul Gem Pile',['message']='A medium gear would be found without much hassle:\\n\\nPerhaps there are other things to find?\\n\\nROLLS:\\n\\n- Roll 60+ to find something (1d100)\\n- If successful, roll again (3d4)\\n\\n1-4 = Low-tier reward\\n5-9 = Medium-tier reward\\n10-11 = High-tier reward\\n12 = Legendary reward\\n\\nWhisper me (@thepsychoticaltmer) so I can DM your reward!\\n\\n(ONE PERSON ONLY)',},['SizeX']=22,['Id']=1133,},[10]={['Groups']=0,['SizeY']=26,['Y']=19603,['Pitch']=1.570971,['Color']=102439,['Roll']=3.141767,['SizeZ']=26,['Alpha']=0.060000,['EffectType']=8502,['Yaw']=5.134759,['Contrast']=1,['X']=109384.616960,['Z']=107136.842773,['MetaData']={['title']='The New Falmer Empire!',['message']='\\nVICTORY!\\n\\nWe have prevailed against vile treachery, and once again sit the throne of this land that is our home!\\n\\nWe drove those who came from across the sea back to their blighted homeland, lest their fumbling hands drive us all into ruin. Upon their return, with dark arts and cruelty unmatched, they toppled millenia of culture and history: a force of Five-Hundred Demons who devoured all we held dear.\\n\\nIn desperation after our final loss, we turned to the Dwemer here: who would have finished our people off with the same cruelty, deceit and barbarity that they condemn the Ash-Kin of Resdayn for.\\n\\nWe caught on to this plan, and through superior wit and spirit, have struck down the Mage-Architects. The corpses of their soldiers and craftlords shall feed our plants, and their brass-heart creations now serve us.\\n\\nTo all Dwemer reading this: comply with our new Empire, and join us in rebuilding what the Falmer once were, and you will reap the benefits. Resist, and you will understand the reason why your Lords had you hide in the mountains and caves under OUR Land.\\n\\n--------------------------------------------------------------\\n\\n*The person who received this particular copy of the declaration seems to have not taken it particularly seriously: drawing an arrow from the bottom of the text towards a very amusingly realistic rendition of fecal matter in bright, blue ink*',},['SizeX']=24.456456,['Id']=1134,},[11]={['Groups']=0,['Y']=19629,['Pitch']=0,['Color']=993836,['Id']=1135,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=107101.698192,['X']=109442.520739,['SizeX']=97,['Yaw']=3.054326,},[12]={['Groups']=0,['Y']=19632,['Pitch']=0,['Color']=993836,['Id']=1137,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=107117.857448,['X']=109563.249974,['SizeX']=97,['Yaw']=3.054326,},[13]={['Groups']=0,['Y']=19757,['Pitch']=0,['Color']=429924,['Id']=1138,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.810000,['Z']=105154.240162,['X']=108767.018561,['SizeX']=95,['Yaw']=3.054326,},[14]={['Groups']=0,['Y']=19638,['Pitch']=0,['Color']=993836,['Id']=1139,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.810000,['Z']=107192.849468,['X']=109360.173107,['SizeX']=97,['Yaw']=3.054326,},[15]={['Groups']=0,['Y']=19601,['Pitch']=0,['Color']=993836,['Id']=1140,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=104244.728654,['X']=107460.098441,['SizeX']=95,['Yaw']=3.054326,},[16]={['Groups']=0,['Y']=19635,['Pitch']=0,['Color']=993836,['Id']=1141,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=104317.386185,['X']=107343.567660,['SizeX']=95,['Yaw']=3.054326,},[17]={['Groups']=0,['SizeY']=30,['Y']=19599,['Pitch']=1.832596,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0.040000,['EffectType']=8502,['Yaw']=2.617994,['Contrast']=1,['X']=109565.521555,['Z']=107124.376132,['MetaData']={['title']='Bad Poetry',['message']='\\nOnly in the dark\\nBeyond vengeance from above\\nCan we thrive again\\n\\nHer ivory skin \\nDead blue eyes\\nThat unsettling grin \\nHer endless lies\\n\\nI may not believe \\nBut I cannot leave',},['SizeX']=26.456456,['Id']=1142,},[18]={['Groups']=0,['Y']=19695,['Pitch']=0,['Color']=339929,['Id']=1144,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.750000,['Z']=105016.234370,['X']=107294.891242,['SizeX']=95,['Yaw']=3.054326,},[19]={['Groups']=0,['SizeY']=30,['Y']=19767,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['Yaw']=4.356342,['Contrast']=1,['X']=108748.229813,['Z']=105152.073414,['MetaData']={['title']='Schematics',['message']='These complex diagrams assume the reader is skilled in understanding Dwemer technology and mechanics: because it certainly makes no effort to explain the details to those who don\\'t. A particularly perceptive layman might notice that the circular shape within the diagram resembles the sphere hanging above, but nothing more.',},['SizeX']=26.456456,['Id']=1146,},[20]={['Groups']=0,['Y']=19588,['Pitch']=0,['Color']=993836,['Id']=1147,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=103030.095352,['X']=107886.477075,['SizeX']=95,['Yaw']=3.054326,},[21]={['Groups']=0,['Y']=19544,['Pitch']=0,['Color']=993836,['Id']=1148,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=103895.422847,['X']=108934.591190,['SizeX']=95,['Yaw']=3.054326,},[22]={['Groups']=0,['SizeY']=30,['Y']=19595,['Pitch']=4.712564,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8502,['Yaw']=0,['Contrast']=1,['X']=109356.232749,['Z']=107183.543032,['MetaData']={['title']='Shimmering Bottle',['message']='\\n\\'Vintage \\'89, Reserve from the vineyards of Eltnium\\'\\n\\nThe glass has a unique shape: a silvery dome with hints of blue, made up of hundreds of tiny circles. Upon touch, you would notice the glass is remarkably cold, and upon further inspection you\\'d realise the bottle is made up of tiny, eternally-suspended shards of ice.',},['SizeX']=26.456456,['Id']=1150,},[23]={['Groups']=0,['SizeY']=30,['Y']=19711,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8502,['Yaw']=1.570796,['Contrast']=1,['X']=109083.478499,['Z']=107257.569831,['MetaData']={['title']='Letter from Gelebor',['message']='\\nHelaire,\\n\\nI am shocked that you wrote to me, truly. By the time news of the Snow Prince\\'s fall reached us, you had all already went to the Dwemer and we had written you off as lost. You have no idea how much comfort it brings me to learn of your survival, friend.\\n\\nThe Chantry of Auri-El still stands. The Altmorans have yet to discover this place, and the Dwemer couldn\\'t discover it even if they tried. I can tell you little about the state of our people, beyond that what the Dwemer tried to do to you in Mzudan-Chel was not an isolated incident.\\n\\nI do not believe that many Falmer were as lucky as you were in retaliating. It is a tragedy, but you should focus on surviving in Mzudan-Chel without the Dwemer learning of your continued rule. The Chantry does not have the numbers to support you if they do. \\n\\nWhat you have written to me about Gwenaine\\'s magic is certainly concerning. Conducting experiments on the Dwemer is barbaric, but a necessary barbarism in the times we face, but shadowmancy? She is dipping her toe into an ocean that threatens to drown her, and an acolyte of Jephre should know better.\\n\\nWatch her, very carefully. Power mixed with temptation is volatile, least of all the power of the Void. Do what you have to do to save our people from greater destruction, even if it means killing her.\\n\\nI hope we can meet again one day. Vyrthur and I will hold the line, and ensure the Chantry stands. My brother is a capable and pious Arch-Curate, I have no doubt he will have a plan to save our people.\\n\\nYour friend, Knight-Paladin Gelebor. \\n\\n',},['SizeX']=26.456456,['Id']=1151,},[24]={['Groups']=0,['SizeY']=30,['Y']=19517,['Pitch']=5.235988,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8502,['Yaw']=5.323254,['Contrast']=1,['X']=108948.774405,['Z']=103887.011066,['MetaData']={['title']='Canopic Jars',['message']='Three jars lie on the ground: filled with an impenetrably murky yellow-green mucous that obscured the entirety of the contents.\\n\\nSome things would manage to peek through the disgusting substance, however.\\n\\nIn the left jug, a wrinkled pink brain would be floating at the very top.\\n\\nIn the middle jug, a severed hand would be pressed against the glass. It is distinctly that of a man.\\n\\nIn the right jug, an eye would peek up from above the muck: obviously elven, yet filled with the dim fade of old age.',},['SizeX']=26.456456,['Id']=1152,},[25]={['Groups']=0,['SizeY']=30,['Y']=19688,['Pitch']=5.927138,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=1,['EffectType']=8502,['Yaw']=5.148721,['Contrast']=1,['X']=108966.685154,['Z']=103712.894426,['MetaData']={['title']='Subject #3824: Details',['message']='RACE: Dwemer\\nAGE: 307\\nGENDER: Male\\nCAUSE OF DEATH: Unfit for work\\nPROJECT: Duality',},['SizeX']=26.456456,['Id']=1153,},[26]={['Groups']=0,['Y']=19726,['Pitch']=0,['Color']=993836,['Id']=1154,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=107234.162778,['X']=109133.493930,['SizeX']=97,['Yaw']=3.054326,},[27]={['Groups']=0,['Y']=19626,['Pitch']=0,['Color']=329927,['Id']=1155,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.810000,['Z']=107140.953821,['X']=109381.553212,['SizeX']=97,['Yaw']=3.054326,},[28]={['Groups']=0,['Y']=19765,['Pitch']=0,['Color']=993836,['Id']=1156,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=104892.818764,['X']=108700.729435,['SizeX']=95,['Yaw']=3.054326,},[29]={['Groups']=0,['Y']=19711,['Pitch']=0,['Color']=993836,['Id']=1157,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=103726.031286,['X']=108942.259962,['SizeX']=95,['Yaw']=3.054326,},[30]={['Groups']=0,['Y']=19611,['Pitch']=0,['Color']=993836,['Id']=1158,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=104293.002252,['X']=107450.713487,['SizeX']=95,['Yaw']=3.054326,},[31]={['Groups']=0,['SizeY']=30,['Y']=19618,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8502,['Yaw']=1.134464,['Contrast']=1,['X']=107304.772630,['Z']=104302.547044,['MetaData']={['title']='Crystals',['message']='A collection of neatly stacked, ordered crystals in different colours: muted vermillions, cyans, lavenders and pinks',},['SizeX']=26.456456,['Id']=1159,},[32]={['Groups']=0,['Y']=19642,['Pitch']=0,['Color']=993846,['Id']=1165,['SizeZ']=16,['Alpha']=1,['EffectType']=8,['SizeY']=16,['Roll']=0,['Contrast']=2.260000,['Z']=104864.036443,['X']=107216.937800,['SizeX']=100,['Yaw']=1.570796,},[33]={['Groups']=0,['Y']=19726,['Pitch']=0,['Color']=994449,['Id']=1166,['SizeZ']=19,['Alpha']=1,['EffectType']=8,['SizeY']=19,['Roll']=0,['Contrast']=1.400000,['Z']=105062.753604,['X']=108466.810787,['SizeX']=131,['Yaw']=3.141593,},[34]={['Groups']=0,['SizeY']=30,['Y']=19614,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0.110000,['EffectType']=8503,['Yaw']=3.141593,['Contrast']=1,['X']=108466.719841,['Z']=105057.567870,['MetaData']={['title']='Gear Jar',['message']='A dusty, circular dome filled with numerous gears and widgets for engine repair: melded with the brass of the platform. Whether as a security measure to prevent theft, or simply bad design from the Dwemer, one would not be able to move the jar. \\n\\nThe lock is broken, meaning you will have to break the jar to get the gears within. The gears are too large to slip through the cracks, but a few smaller boxes and trinkets could be glimpsed: perhaps if you were quick enough, you could save one or two? \\n\\nRegardless, you would manage to get a small gear from the pile\\n\\nROLLS: \\n\\n- Roll 20+ to save one trinket\\n- Roll 60+ to save two trinkets \\n- Roll 90+ to save three trinkets. \\n- If successful, roll 3d4 for each trinket\\n\\n1-4 = Low-tier reward\\n5-9 = Medium-tier reward\\n10-11 = High-tier reward\\n12 = Legendary-tier reward\\n \\n',},['SizeX']=26.456456,['Id']=1167,},[35]={['Groups']=0,['X']=107262.519407,['Y']=19551,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['SizeY']=30,['Contrast']=1,['MetaData']={['title']='Frostblast Recipe',['message']='Frostblast is a Falmeri specialty: an alchemical mixture capable of releasing a quick, controlled blast of cold capable of flash-freezing flame. Was historicially useful in conflicts against the Dwemer due to the Falmer\\'s natural resistance to frost: meaning they could toss many of these in close quarters with little risk of damaging themselves or their allies.\\n\\n1) Mix Essence of Valeflower and a shard of ice together till combined, then add to a Frost Compound.\\n\\n2) Place in the condenser till liquid.\\n\\n3) After condensed into a liquid, mix in shards of cyan crystals. Mix together till it reaches the consistency of paste.\\n\\n4) Place in the freezing chamber.\\n\\n5) Place in flask and throw at target.',},['Z']=104996.919887,['Yaw']=1.570796,['SizeX']=26.456456,['Id']=1179,},[36]={['Groups']=0,['Y']=19553,['Pitch']=0,['Color']=993438,['Id']=1180,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=2.180000,['Z']=104978.344262,['X']=107295.615551,['SizeX']=95,['Yaw']=3.054326,},[37]={['Groups']=0,['X']=109784.272770,['Y']=19460,['Pitch']=4.712564,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['SizeY']=30,['Contrast']=1,['MetaData']={['title']='Brass Acid',['message']='WARNING: Brass Acid is incredibly volatile, and requires use of a specialised flask. This flask has been tonally altered to resist the impacts of the acid, as no other flask can safely contain it. One must be kept in the lab at all times: proper sanitisation requires immense heat to evaporate any acidic traces.\\n\\n1). Mix a Generic Compound with chlorine\\n\\n2) Place in the evaporator: try to avoid inhaling the fumes during this process.\\n\\n3) Place the flask under the evaporator, sealing the gas within.\\n\\n4) Pour Acidic Compound into the condenser.\\n\\n5) With the gaseous flask, place it under the flask-port of the condenser. The gas will react with the compound, creating the acid and pouring it into the flask.',},['Z']=107012.518556,['Yaw']=4.712389,['SizeX']=26.456456,['Id']=1181,},[38]={['Groups']=0,['X']=107210.223518,['Y']=19596,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['SizeY']=30,['Contrast']=1,['MetaData']={['title']='Bottle',['message']='A bottle filled with a liquid that hurts to smell: nosehairs singed, eyes watering. The smell is oddly fresh, but utterly pungent. It has a faint reek of bleach.',},['Z']=104867.734498,['Yaw']=1.570796,['SizeX']=26.456456,['Id']=1182,},[39]={['Groups']=0,['X']=108578.869543,['Y']=19955,['Pitch']=0,['Color']=102439,['Roll']=0,['SizeZ']=30,['Alpha']=0,['EffectType']=8503,['SizeY']=30,['Contrast']=1,['MetaData']={['title']='Giant Sphere',['message']='There is a small panel at the base of the sphere, where it meets the switch below. The panel is made up of gears that seem to be missing:\\n\\nOne small gear\\nOne medium gear\\nOne large gear\\n\\nReplacing them should be enough to fix it',},['Z']=105199.210439,['Yaw']=0,['SizeX']=26.456456,['Id']=1184,},[40]={['Groups']=0,['Y']=19492,['Pitch']=0,['Color']=993836,['Id']=1186,['SizeZ']=17,['Alpha']=1,['EffectType']=8,['SizeY']=17,['Roll']=0,['Contrast']=1.740000,['Z']=107014.912413,['X']=109787.096221,['SizeX']=97,['Yaw']=3.054326,},[41]={['Groups']=0,['X']=107389.333304,['Y']=19514,['Pit