,['X']=85053,['Pitch']=0,},[10]={['SizeY']=240,['Yaw']=4.712389,['Alpha']=1,['EffectType']=38,['SizeX']=780,['Contrast']=1,['Roll']=0,['Y']=37254,['Color']=999419,['Groups']=0,['Id']=1018,['SizeZ']=240,['Z']=96467,['X']=88466,['Pitch']=0,},[11]={['SizeY']=800,['Yaw']=0,['Alpha']=1,['EffectType']=38,['SizeX']=400,['Contrast']=1,['Roll']=0,['Y']=36941,['Color']=999419,['Groups']=0,['Id']=1019,['SizeZ']=800,['Z']=91486,['X']=89227,['Pitch']=0,},[12]={['SizeY']=600,['Yaw']=4.712389,['Alpha']=1,['EffectType']=38,['SizeX']=1000,['Contrast']=1,['Roll']=0,['Y']=37481,['Color']=999419,['Groups']=0,['Id']=1020,['SizeZ']=600,['Z']=89320,['X']=92358,['Pitch']=0,},[13]={['SizeY']=820,['Yaw']=3.403392,['Alpha']=1,['EffectType']=38,['SizeX']=620,['Contrast']=1,['Roll']=0,['Y']=37513,['Color']=999419,['Groups']=0,['Id']=1021,['SizeZ']=820,['Z']=87183.927646,['X']=87524.959567,['Pitch']=0,},[14]={['SizeY']=1000,['Yaw']=1.570796,['Alpha']=1,['EffectType']=38,['SizeX']=1000,['Contrast']=1,['Roll']=0,['Y']=37870,['Color']=999419,['Groups']=0,['Id']=1022,['SizeZ']=1000,['Z']=83624,['X']=84896,['Pitch']=0,},[15]={['SizeY']=600,['Yaw']=2.879793,['Alpha']=1,['EffectType']=12,['SizeX']=700,['Contrast']=1,['Roll']=0,['Y']=35065,['Color']=0,['Groups']=0,['Id']=1037,['SizeZ']=600,['Z']=83158.362080,['X']=80144.722468,['Pitch']=4.747296,},[16]={['SizeY']=260,['Yaw']=3.033382,['Alpha']=0,['EffectType']=4508,['SizeX']=240,['Contrast']=1,['Roll']=0,['Y']=35185,['Color']=999999,['Groups']=0,['Id']=1038,['SizeZ']=260,['Z']=83179.784051,['X']=80123.836509,['Pitch']=0,},[17]={['SizeY']=30,['Groups']=0,['Y']=37088,['Alpha']=0,['Yaw']=3.141593,['SizeX']=26.456456,['Contrast']=1,['Roll']=0,['Color']=102439,['EffectType']=8502,['MetaData']={['title']='Fate of Nocturnal´s follower I',['message']='In time of the assault on Clockwork City, a few followers of Nocturnal were tasked with stealing a key. The Skeleton key. Three they were. They made a plan. There are only two ways, beside the main gate, to get into the city. The first is by portal which required both entrance portal and exit portal, second option is under the city itself. Which lead to right wing within the city. One of the exits is from beneath is through an Incarnatorium. \\n\\n',},['Id']=1039,['SizeZ']=30,['Z']=88978.535705,['X']=84988.392735,['Pitch']=0,},[18]={['SizeY']=30,['Groups']=0,['Y']=37088,['Alpha']=0,['Yaw']=3.141593,['SizeX']=26.456456,['Contrast']=1,['Roll']=0,['Color']=102439,['EffectType']=8502,['MetaData']={['title']='Fate of Nocturnal´s follower II',['message']='When the time was right and armies started marching to the city. Plan was set to motion. They sneaked under the city, right to the Incarnatorium without trouble. The Incarnatorium was malfunctioning that time, mechanic creatures were spawning without control.\\n \\nBut all three of them made it through without any serious wounds. After that, they were going through an oily scrapyard in shape of canyon. There they were ambushed. \\n\\nGuards were aware that right wing is a possible way. Hard to tell how many there were, even harder to tell how many facilitators there were. Only thing sure is, none of them were mage or animalistic mechatronic. Neither none of them had maces or hammers. \\n\\nThree was caught by surprise, but didn��t retreat, instead they unsheathed weapons and stand their ground. Sharp blades were flying everywhere, blood squirted. Three killed lot of guards. But there were still many of them.                    Three was still standing and fighting, even with wounds they suffered, not accepting to fail. \\n\\nThree fought and fought, with hope of winning. Until first of Three fell under heavy wounds. Soon after. Second one followed. And altmer was only one left. Seeing friends dying filled her with rage. With eyes full of tears, she was slaughtering them without mercy. Then she got cut over right wrist, her hand suddenly became too weak to hold sword. She took her sword to left hand while covering her blood-soaked belly with right hand, not ready to give up. \\n\\nLast attacker fell under her blade, but she was losing blood fast. She dropped sword next to her. Trying to stand on her feet, however she was getting weaker and weaker. To a moment when she fell to oil filled ground, suddenly rage was gone. Tears burst from her eyes, knowing her fate, the end of her journey.',},['Id']=1040,['SizeZ']=30,['Z']=89054.533779,['X']=84987.851683,['Pitch']=0,},[19]={['SizeY']=30,['Groups']=0,['Y']=37166,['Alpha']=0,['Yaw']=1.570796,['SizeX']=26.456456,['Contrast']=1,['Roll']=0,['Color']=102439,['EffectType']=8501,['MetaData']={['title']='notes',['message']='A sword wasn´t rusty or damaged when I found it, just dirty. Also doesn´t seem to have marks from fight neither, yet there was a fight as the body that was found near had damaged armor. Female altmer, not much decayed, if I should guess probably oil kept it in such condition. \\n\\nSeems like mid-aged, maybe bit younger. Although the age, she must have seen quite few battles as she has got scars, some of them are healed really good. Scars usually take few years to heal that good which supports my theory. The woman has newer wounds also, fatal wounds, cause of death. No bruises, only cutting wounds, that indicate she was there willingly. Most of these wounds are located on the upper body in front, especially on belly. However, wounds are also on her back, arms and legs. These wounds are not fatal though, neither cause of death. Only serious one is on the right wrist over a vein, not deep enough to be cause of death, but deep enough to weaken her. \\n\\nI can´t recognize for sure if she was sick, blood in her body is too merged with oil, but I think she was healthy.\\n\\nA cloth on her armor is dark black with silver lines, but in certain angles seem like dark blue. The legs are from the same dark material, yet without the silver lining. Under a cloth is metallic armor, the same alloy like the sword is from. Unlike the others, her metallic armor is all under cloth. Metallic parts are not separated from cloth, instead it´s one piece. The armor has cuts in spots of her wounds, otherwise it´s untouched. I will write a separated note of what could ',},['Id']=1041,['SizeZ']=30,['Z']=92506.477205,['X']=74795.947153,['Pitch']=4.712564,},},['Version']=1762,}"
